import React from 'react'
import StudentInput from './StudentInput'

const Student = (props) => {
  return (
    <div key={props.student.id}>
    <p>Name: {props.student.name}</p>
    <p>Age: {props.student.age}</p>
    <p>Gender: {props.student.gender} </p>
    <StudentInput studentId={ props.student.id} updateStudent={props.updateStudent}/>
  </div>
)
}

export default Student;
